package Labs_1.LabExercise_19;public class WrapperDemo {    public static void main(String[] args) {        int x = 30;        Integer i = Integer.valueOf(x);        String str = String.valueOf("100");        Double dou=Double.valueOf(200.09);        Float fl=Float.valueOf(20.9f);        Long lg=Long.valueOf(200089);        System.out.println("Integer- "+i);        System.out.println("String- "+str);        System.out.println("Double- "+dou);        System.out.println("Float- "+fl);        System.out.println("Long- "+lg);    }}